import React, { Component } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
//
import { API_URL } from "../../services/url";
import SimpleReactValidator from "simple-react-validator";
export class VIEW7 extends Component {
  constructor(props) {
    super(props);
    this.state = {
      verified_by1: "",
      verify_comment: "",
      res: "",
      res1: "",
      res2: "",
      res3: "",
      res4: ""
    };
    this.onSubmit = this.onSubmit.bind(this);
    this.validator = new SimpleReactValidator();
  }
  componentDidMount() {
    this.getFormDetail();
    var today = new Date();
    var dd = today.getDate();
    var mm = today.getMonth() + 1; //January is 0!
    var yyyy = today.getFullYear();

    if (dd < 10) {
      dd = "0" + dd;
    }

    if (mm < 10) {
      mm = "0" + mm;
    }

    today = yyyy + "/" + mm + "/" + dd;
    console.log("date here", today);
    this.state.date = today;
    console.log(this.state.date);
  }

  async change(e, id) {
    let load = e.target.value;
    let weight = e.target.value;
    let testdate = e.target.value;
    const oneDay = 24 * 60 * 60 * 1000;
    console.log(load);
    console.log(id);

    switch (e.target.id) {
      case "load":
        let strength = load / 10;
        document.getElementById(`strength${id}`).value = strength;
        break;
      case "weight":
        let density = weight * 1000;
        document.getElementById(`density${id}`).value = density;
        break;
      case "testdate":
        let cubeage = Math.round(
          (Date.parse(this.state.date) - Date.parse(testdate)) / oneDay
        );
        document.getElementById(`cubeage${id}`).value = cubeage;
        break;
    }
    // {
    //    [e.target.name]: e.target.value
    // }

    // () => {
    //   const { wa1, load1, d1, date } = this.state;
    //   const oneDay = 24 * 60 * 60 * 1000;

    //   this.setState({
    //     // density_air1: wa1 * 1000,
    //     // strength1: load1 / 10,
    //     // cubeage1: Math.round((Date.parse(date) - Date.parse(d1)) / oneDay)
    //   });
    //   console.log(this.state.cubeage1);
    // }
  }

  getFormDetail = async () => {
    // try {
    console.log(this.props.match.params.id);
    const response = await axios.get(
      `${API_URL}cube/view_rf7/view/${this.props.match.params.id}`,
      (axios.defaults.headers.common["x-access-token"] = localStorage.getItem(
        "token"
      ))
    );
    console.log("verifyrf7 data", response.data);
    // this.state.res2 = response.data.data4;
    // let res3 = response.data.data3;
    // res3.push(...this.state.res2);
    const res3 = [...response.data.data3, ...response.data.data4];

    await this.setState({
      res1: response.data.data1[0],
      res: response.data.data2[0],
      res4: res3
    });
    console.log(this.state.res4);

    // const map = {};
    // res.map(async (item, i) => {
    //   console.log(item.question + "  " + item.answer);
    // map[item.question] = item.answer;
    // });
  };

  getWebsite = () => {
    fetch("/").then(console.log(this.state));
  };

  async onSubmit(event) {
    event.preventDefault();
    console.log(this.state);
    if (this.validator.allValid()) {
      let tokenvalue = localStorage.getItem("token");
      let body = {
        verify_comment: this.state.verify_comment,
        formid: this.props.match.params.id
      };
      console.log("body hare", body);
      try {
        const response = await axios.post(
          `${API_URL}rf_form/verify`,
          body,
          (axios.defaults.headers.common["x-access-token"] = tokenvalue)
        );
        console.log(response);

        if (response.data === "verified") {
          alert(response.data);
          this.props.history.push("/ViewParticleSize");
        } else {
          alert(response.data);
        }
      } catch (error) {
        console.log(error);
      }
    } else {
      this.validator.showMessages();
      // rerender to show messages for the first time
      this.forceUpdate();
    }
  }

  render() {
    return (
      <div className="skin-blue fixed-layout">
        <div className="page-wrapper">
          <div className="container-fluid">
            <div className="row page-titles">
              <div className="col-md-5 align-self-center">
                {/* <h4 className="text-themecolor">Forms</h4> */}
                <nav aria-label="breadcrumb">
                  <ol class="breadcrumb">
                    <li className="breadcrumb-item">
                      <Link to={process.env.PUBLIC_URL + "/"}>Home</Link>
                    </li>
                    <li className="breadcrumb-item active" aria-current="page">
                      RF - 07
                    </li>
                  </ol>
                </nav>
              </div>
            </div>
          </div>

          {/*Form content begin */}

          <div className="product-form-upper">
            <div className="container-fluid">
              <div className="below-custom-form">
                <div className="row">
                  <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12" />

                  <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12">
                    <p style={{ textAlign: "center" }}>
                      <h3>RF - 07</h3>
                      Certification of sampling and testing of concrete
                    </p>
                    <hr />
                  </div>
                </div>
                <form className="custom-content-form">
                  <div className="form-row">
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-2 col-form-label"
                        >
                          Plant
                        </label>
                        <div class="col-sm-10">
                          <input
                            type="text"
                            name="plant"
                            value={this.state.res.ORG_NAME}
                            onChange={e => this.change(e)}
                            className="form-control"
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-2 col-form-label"
                        >
                          Batching Time
                        </label>
                        <div class="col-sm-10">
                          {" "}
                          <input
                            type="text"
                            name="batch_time"
                            value={this.state.res.PRODUCTION_TIME}
                            onChange={e => this.change(e)}
                            className="form-control"
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-2 col-form-label"
                        >
                          Date Of Supply
                        </label>
                        <div class="col-sm-10">
                          <input
                            type="text"
                            name="date"
                            value={this.state.date}
                            onChange={e => this.change(e)}
                            className="form-control"
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-2 col-form-label"
                        >
                          Sampling Location
                        </label>
                        <div class="col-sm-10">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="sample_location"
                            value={this.state.res.sampling_loc}
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-2 col-form-label"
                        >
                          Customer
                        </label>
                        <div class="col-sm-10">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="customer"
                            value={this.state.res.CUSTOMER_NAME}
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputSubcategory"
                          className="col-sm-2 col-form-label"
                        >
                          Plant Slump
                        </label>
                        <div class="col-sm-10">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="plant_slump"
                            value={this.state.res.plant_slump}
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-3 col-form-label"
                        >
                          Project / Site
                        </label>
                        <div class="col-sm-9">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="project"
                            value={"NO DATA"}
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-3 col-form-label"
                        >
                          Sampling Time
                        </label>
                        <div class="col-sm-9">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="sampling_time"
                            value={this.state.res.sampling_time}
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-12">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-3 col-form-label"
                        >
                          Sampling Slump
                        </label>
                        <div class="col-sm-9">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="sampling_slump"
                            value={this.state.res.sampling_slump}
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-3 col-form-label"
                        >
                          Delivery Ticket No
                        </label>
                        <div class="col-sm-9">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="delivery"
                            value={this.state.res.BATCH_NUMBER}
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-3 col-form-label"
                        >
                          Casting Time
                        </label>
                        <div class="col-sm-9">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="casting_time"
                            value={this.state.res.casting_time}
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-3 col-form-label"
                        >
                          Mix Code
                        </label>
                        <div class="col-sm-9">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="mix_code"
                            value={this.state.res.FG_CODE}
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-3 col-form-label"
                        >
                          Casting Slump
                        </label>
                        <div class="col-sm-9">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="casting_slump"
                            value={this.state.res.casting_slump}
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-3 col-form-label"
                        >
                          Grade Of Concrete
                        </label>
                        <div class="col-sm-9">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="grade_concrete"
                            value={"NO DATA"}
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-3 col-form-label"
                        >
                          Specimen Size
                        </label>
                        <div class="col-sm-9">
                          <input
                            className="form-control"
                            type="text"
                            id="inputPassword"
                            value={this.state.res1.size}
                            name="specimen_size"
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
                        <label
                          for="inputPassword"
                          class="col-sm-3 col-form-label"
                        >
                          Specified Slump
                        </label>
                        <div class="col-sm-9">
                          <input
                            type="text"
                            class="form-control"
                            id="inputPassword"
                            name="specified_slump"
                            value={this.state.res.sampling_slump}
                            onChange={e => this.change(e)}
                            disabled
                          />
                        </div>
                      </div>
                    </div>
                    <div class="form-group col-md-6">
                      <div class="form-group row">
